CREATE TABLE eplusi.youth
(
    youth_id int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    youth_name varchar(20) NOT NULL,
    youth_peer char(2) COMMENT '또래',
    gender char(1),
    birth_date date,
    cell_phone varchar(11),
    home_address varchar(100),
    is_born_chr tinyint(1) DEFAULT '1' COMMENT '모태신앙여부',
    is_self_in tinyint(1) DEFAULT '0' COMMENT '자진등록여부',
    guide_name varchar(20) COMMENT '인도자->view_(youth,christian,worker)_id->청년, 집사님, 전도사님 중 인도자가 있을 수 있으므로',
    occ_type_code int(11) COMMENT '직업 상태 - 대학생/직장인/기타',
    occ_code int(11) COMMENT '사람인 기준 직업 코드',
    biz_type_code int(11),
    religion_type_code int(11) COMMENT '신급',
    church_reg_date date COMMENT '교회 등록 날짜',
    is_attending tinyint(1) DEFAULT '1' NOT NULL COMMENT '출석 상태 - 유학/지방이전 상태라 할지라도 리더의 판단에 따라 교회에 나오지 않는다 판단되면 False',
    is_registered tinyint(1) DEFAULT '1',
    update_time timestamp DEFAULT CURRENT_TIMESTAMP,
    create_time timestamp DEFAULT CURRENT_TIMESTAMP NOT NULL,
    CONSTRAINT youth_occ_type_occ_type_code_fk FOREIGN KEY (occ_type_code) REFERENCES code.occ_type (occ_type_code) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT youth_occ_occ_code_fk FOREIGN KEY (occ_code) REFERENCES code.occ (occ_code) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT youth_biz_type_biz_type_code_fk FOREIGN KEY (biz_type_code) REFERENCES code.biz_type (biz_type_code) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT youth_religion_type_religion_type_code_fk FOREIGN KEY (religion_type_code) REFERENCES code.religion_type (religion_type_code) ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE INDEX youth_occ_type_occ_type_code_fk ON eplusi.youth (occ_type_code);
CREATE INDEX youth_occ_occ_code_fk ON eplusi.youth (occ_code);
CREATE INDEX youth_biz_type_biz_type_code_fk ON eplusi.youth (biz_type_code);
CREATE INDEX youth_religion_type_religion_type_code_fk ON eplusi.youth (religion_type_code);
